import React, { useState } from 'react';
import Book from '../pages/book';

function SearchList({ filteredBook }) {
    const filtered = filteredBook.map((item) => item.name);
    return (
        <div>
            <Book item={filtered} />
        </div>
    );
}

export default SearchList;
